import { FC, useState } from 'react';

type AddTodoProps = {
  onNewTodo: (todoName:string) => void
}

const AddTodo: FC<AddTodoProps> = ({onNewTodo}) => {

  const [todoName, setTodoName] = useState('')

  return (
    <form onSubmit={event => {
      onNewTodo(todoName)
      setTodoName('')
    }}
    >
      <input
        type="text"
        name='todoName'
        value={todoName}
        onChange={event => {
          setTodoName(event.target.value)
        }}
      />
      <button>+</button>
    </form>
  );
};

export default AddTodo;
